import logo from '../resources/apex_logo.svg';
import '../App.css';

function Header(props) {
    const bots = props.bots;
    const botItems = bots.map(element => {
        console.log({element});
        const className = props.selectedBot == element ? "App-header-bot-item-selected" : "App-header-bot-item";
        return <button className={className}>{element}</button>
    });
    console.log({botItems});
    return (
        <header className="App-header">
            <img src={logo} alt="ApexBots" onClick/>

            <div className="App-header-separator"></div>
            <div className="App-header-bots">
                {botItems}
            </div>
        </header>
    );
}

export default Header;
